import React from 'react';

const Home = () => {
  return (
    <div>
      <h2>Corbin Robb</h2>

      <h3>Location: Denver CO</h3>

      <h3>What I Do</h3>
      <ul>
        <li>React</li>
        <li>JavaScript</li>
        <li>Node</li>
        <li>HTML</li>
        <li>CSS</li>
        <li>SQL</li>
      </ul>
    </div>
  );
}

export default Home;
